import React from "react";
import { Typography, Link } from "@material-ui/core";

const Footer = (classes) => {
  return (
    <Link className="Footer" to="https://github.com/jeremya-lagash/PokeAPP">
      <Typography variant="h6">PokeAPP</Typography>
    </Link>
  );
};

export default Footer;
